import React from 'react';
import Nav from './Nav';
import './css/resturant.css';

function Resturant() {
  return (
    <div className='resturant' > 
      <div className='sec-4'><Nav/>

      </div>
      <div className='sec-5'>
        <div></div>
        <div className='re-box'></div>
        <div className='re-box'></div>
        <div className='re-box'></div>
      </div>
        
        
    </div>
  );
}

export default Resturant;
